			var radar=me._floor_plan_twin_spring.ggRadar;
			var d2r = Math.PI/180 ;
			var fov = player.getFov();
			var pan = player.getPanNorth();
			pan -= me._floor_plan_twin_spring.ggFloorplanNorth;
			var filterpassed = true;
			var currentId = player.getCurrentNode();
			if (me._floor_plan_twin_spring.ggFilteredIds.length > 0 && me._floor_plan_twin_spring.ggFilteredIds.indexOf(currentId) == -1) filterpassed = false;
			if ((me._floor_plan_twin_spring.ggSimpleFloorplanMarkerArray.hasOwnProperty(currentId)) && filterpassed) {
				var activeMarker = me._floor_plan_twin_spring.ggSimpleFloorplanMarkerArray[currentId];
				if ((radar.radarElement) && (fov==radar.lastFov) && (pan==radar.lastPan) && (activeMarker.radarXPos==radar.xPos) && (activeMarker.radarYPos==radar.yPos)) return; 
				radar.lastPan=pan; radar.lastFov=fov;
				radar.xPos=activeMarker.radarXPos; radar.yPos=activeMarker.radarYPos;
				if (radar.radarElement) me._floor_plan_twin_spring__mapdiv.removeChild(radar.radarElement);
				radar.radarElement = document.createElementNS('http://www.w3.org/2000/svg','svg');
				radar.radarElement.setAttributeNS(null,'width',300);
				radar.radarElement.setAttributeNS(null,'height',300);
				radar.radarElement.setAttributeNS(null,'viewBox','0 0 300 300');
				var radarPath = document.createElementNS('http://www.w3.org/2000/svg','path');
				radarPath.setAttributeNS(null,'id','radarPath');
				pan = -90 - pan;
				var arcX1 = 150 * Math.cos((pan - fov / 2) * d2r);
				var arcY1 = 150 * Math.sin((pan - fov / 2) * d2r);
				var arcX2 = 150 * Math.cos((pan + fov / 2) * d2r);
				var arcY2 = 150 * Math.sin((pan + fov / 2) * d2r);
				arcX1 += 150;
				arcY1 += 150;
				arcX2 += 150;
				arcY2 += 150;
				var radarPathString = 'M150,150 L' + arcX1 + ',' + arcY1 + ' A 150 150 0 0 1 ' + arcX2 + ' ' + arcY2 +' Z';
				radarPath.setAttributeNS(null,'d', radarPathString);
				radarPath.setAttributeNS(null,'fill', '#55565a');
				radarPath.setAttributeNS(null,'fill-opacity', 0.35);
				radarPath.setAttributeNS(null,'stroke', '#55565a');
				radarPath.setAttributeNS(null,'stroke-opacity', 0.8);
				radarPath.setAttributeNS(null,'stroke-width', 1);
				radarPath.setAttributeNS(null,'stroke-linejoin', 'miter');
				radar.radarElement.appendChild(radarPath);
				me._floor_plan_twin_spring__mapdiv.appendChild(radar.radarElement);
				var radarXPos = activeMarker.radarXPos - 150;
				var radarYPos = activeMarker.radarYPos - 150;
				radar.radarElement.style['position'] = 'absolute';
				radar.radarElement.style['left'] = '' + radarXPos + 'px';
				radar.radarElement.style['top'] = '' + radarYPos + 'px';
				radar.radarElement.style['z-index'] = me._floor_plan_twin_spring.style['z-index'] + 1;
			} else {
				if (radar.radarElement) {
					me._floor_plan_twin_spring__mapdiv.removeChild(radar.radarElement);
					radar.radarElement = null;
				}
			}
